. Максимальная комплектация. В одних руках с 2018 года. Двигатель и коробка без вопросов. Полностью технически исправен. На пробеге 240000км произведена замена цепей. Все заявленные в комплектации опции работают. Маневренный и легко управляемый. Подвеска без нюансов едет мягко, не гремит и не стучит. По технической части все включается и работает в штатном режиме без нареканий. Максимально практичный и удобный в эксплуатации автомобиль. 

