Премиум отделка салона (перфорированная кожа сидений, алькантара, полированный алюминий). 3-х спицевой кожаный руль в S-line, 3 варианта освещения салона. Доводчики дверей, доступ без ключа, система старт-стоп, камера заднего вида, электрические шторки, TV, DVD, СD, SD cards, NAVI, 4-х зонный климатконтроль, подогрев руля, память сидений и зеркал. Массаж, вентиляция и подогрев всех сидений.

В ходе диагностики, не выявлено никаких недостатков. На данный момент не требует абсолютно никаких вложений. 
Мы находимся по адресу Дунина-Марцинкевича 3/1 на минус 2-ом уровне крытого паркинга ТЦ «Тивали» где всегда тепло и сухо, так что вне зависимости от погоды, Вы можете комфортно и внимательно его осмотреть. Всего в 300м. от ст.м "Спортивная" и 600м от ст.м "Пушкинская".

Огромная просьба звонить перед выездом к нам на площадку.

- снят с учета;

- готова к продаже;

- продажа в Кредит и Лизинг;

- гарантия юридической чистоты;

- приём авто в Зачет (trade-in);

- наши Авто проходят диагностику и предпродажную проверку;

- аргументированный торг.

